import './topbar.css';
import '../bootstrap.min.css';

export default function TopBar() {
  return (
    <div className='top'>
        <div className="row">
            <div className="col-md-4" >
                <h2>&nbsp;Pragmata</h2>
            </div>
            <div className="col-md-4" >
                <img src="src/img/ukraine.png"  alt=""/>
                <br />
                <img src="../img/freeukraine.png"  alt="" />
            </div>
            <div className="col-md-4 alright"  >
                <h2>πράγματα</h2>
            </div>
        </div>
    </div>
  )
}
